    "css_color": {                                   "en": "h-shadow: Required. The position of the horizontal shadow. Negative values are allowed", "de": "inset: Die Angabe ist optional. Wenn nicht festgelegt, wird angenommen, dass es sich um einen Schlagschatten handelt.", "ru": "inset: Тень выводится внутри элемента. Необязательный параметр.", "zh-cn": "h-shadow：必填。水平阴影的位置。允许负值"},
    "css_cursor": {                                  "en": "v-shadow: Required. The position of the vertical shadow. Negative values are allowed", "de": "X-Verschiebung Y-Verschiebung: Eine Angabe ist erforderlich. Es gibt zwei Längenwerte, die die Verschiebung des Schattens angeben. Negative Werte sind auch möglich.", "ru": "сдвиг по x: Смещение тени по горизонтали относительно элемента. Положительное значение этого параметра задает сдвиг тени вправо, отрицательное — влево. Обязательный параметр.", "zh-cn": "v-shadow：必填。垂直阴影的位置。允许负值"},
    "css_display": {                                 "en": "blur: Optional. The blur distance",               "de": "Unschärfe-Radius: Die Angabe ist optional und Null, wenn kein <Unschärfe-Radius> gesetzt wurde. Je großer der Wert, desto größer die Unschärfe.", "ru": "сдвиг по y: Смещение тени по вертикали относительно элемента. Положительное значение задает сдвиг тени вниз, отрицательное — вверх. Обязательный параметр.", "zh-cn": "模糊：可选。模糊距离"},
    "css_font-family": {                             "en": "spread: Optional. The size of shadow",            "de": "Ausbreitungsradius: Eine weitere Längenangabe, deren Angabe optional ist. Wenn nicht festgelegt ist der Ausbreitungsradius 0 und der Schatten hat die gleiche Größe wie das Element.", "ru": "радиус размытия: Задает радиус размытия тени. Чем больше это значение, тем сильнее тень сглаживается, становится шире и светлее. Если этот параметр не задан, по умолчанию устанавливается равным 0, тень при этом будет четкой, а не размытой.", "zh-cn": "扩散：可选。阴影的大小"},
    "css_font-size": {                               "en": "color: Optional. The color of the shadow. The default value is black. Look at CSS Color Values for a complete list of possible color values.", "de": "Farbe: Die Angabe ist optional. Wenn nicht festgelegt, hängt die Farbe vom Browser ab. In Gecko (Firefox) wird der Wert der color Eigenschaft verwendet.", "ru": "растяжение: Положительное значение растягивает тень, отрицательное, наоборот, ее сжимает. Если этот параметр не задан, по умолчанию устанавливается 0, при этом тень будет того же размера, что и элемент.", "zh-cn": "颜色：可选。阴影的颜色。默认值为黑色。查看CSS颜色值以获取可能颜色值的完整列表。"},
